import React from 'react';
import ReactDOM from 'react-dom';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';

export default ({ food_categories }) => (
    <Paper>
        <Tabs
         value={0} //which tab will be underlined, here tab 2, which is the center tab
         
         indicatorColor="primary"
         textColor="primary"
         centered
         >
         <Tab label="All" />

         <Tabs value={value} onChange={this.handleChange}>
        {
             this.props.tabs.map(
                ({label, path})=><Tab key={label} 
                 label={label} 
                className={classes.tabLink} 
                component={Link} 
                        to={path} />
             )
        }
        </Tabs>

         {food_categories.map(group => //grabbing list of food items
            <Tab label={group} />
         )}
          
          <Tab label="Administrator" />
         </Tabs>
    </Paper>
);
